import React, { Component } from "react"

export default class CriarEnquetePage extends Component {
    render() {
        return (
            <div>
                <label htmlFor="titulo">Título</label>
                <input name="titulo" id="titulo"/> 
                <label htmlFor="inicio">Data de início</label>
                <input type="date" name="inicio" id="inicio"/>
                <label htmlFor="fim">Date de término</label>
                <input type="date" name="fim" id="fim"/>
                <label htmlFor="resposta">Resposta 1</label>
                <input id="resposta"/>
            </div>
        )
    }
}
